243"},"volume_range":{"id":"1289450"}},"code":"if (!window._bt_scale_range) {\n    window._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1289562","type":"CustomJS"},{"attributes":{"coordinates":null,"data_source":{"id":"1289243"},"glyph":{"id":"1289291"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1289293"},"nonselection_glyph":{"id":"1289292"},"view":{"id":"1289295"}},"id":"1289294","type":"GlyphRenderer"},{"attributes":{"data":{"Close":{"__ndarray__":"rkm3JXLBuT/7A+W2fY+6P6DAO/n02Lo/t376z5ofuz9uv3yyYri6P1NZFHZR9Lw/1v1jIToEwD9aSwFp/wPAP9C3BUt1Ab8/AFRx4xbzvz9KtU/HYwa+P5612y40170/6GZ/oNy2vz99dVWgFoPBP+AQqtTsgcI/ONkG7kCdwj/d0mpI3GPDP0jdzr7yIMM/0v2cgvxsxD8I5ujxe5vAP9dMvtnmxsI/1gJ7TKQ0wT+HbYsyG2TCP0I+6Nms+sI/gXozar5Kwj/xRuaRPxjCP5EotKz7x8I/oS3nUlxVxj8p6zcT04XGPzCBW3fzVMU/CCEgX0IFxT8x7gbRWtHKPxrdQexMock/5s+3BUt1yz97pM
